ged";i:1582368928;s:7:"logotyp";N;s:4:"foto";N;s:5:"nazwa";s:52:"Państwowa Szkoła Muzyczna im.Stanisława Moniuszki";s:6:"powiat";N;s:3:"kod";s:6:"64-360";s:6:"miasto";s:9:"Zbąszyń";s:5:"ulica";s:26:"ul. 17 Stycznia 1920 nr 69";s:7:"telefon";s:26:"tel./fax. (0-68) 846 00 02";s:7:"godziny";N;s:5:"email";s:19:"psmzbasz@polbox.com";s:3:"www";s:17:"free.polbox.pl/pl";s:4:"html";s:1649:"<p><strong>Dyrektor szkoły:</strong> mgr Andrzej Niedziałkowski <br /><strong>HISTORIA:</strong><br />Powstanie Państwowej Szkoły Muzycznej I stopnia im. Stanisława Moniuszki w Zbąszyniu jest nierozerwalnie związane z postacią Antoniego Janiszewskiego, z kt&oacute;rego inicjatywy powstało otwarte 24 września 1950 r. z 35-ciu uczniami Wiejskie Ognisko Muzyczne. Liczne sukcesy zespoł&oacute;w muzycznych i dobre wyniki nauczania spowodowały, że w 1959 r. Ognisko Muzyczne zostało przemianowane na Państwową Szkołę Muzyczną im. St. Moniuszki. <br />Celnym posunięciem dyrektora Janiszewskiego, okazało się <strong>stworzenie w szkole klasy instrument&oacute;w ludowych</strong>. <br />Opiekę nad nią sprawował Tomasz Śliwa - najlepszy koźlarz i budowniczy instrument&oacute;w ludowych na całym obszarze występowania kozła. <br />Jednym z największych sukces&oacute;w w początkowej fazie istnienia szkoły było III miejsce zajęte przez Kapelę Ludową pod kierownictwem Tomasza Śliwy, na XII Międzynarodowym Festiwalu Muzycznym w Llangollen (Wielka Brytania) 1959 r.<br />W 1971 r. z inicjatywy dyrektora Janiszewskiego powstała Dziewczęca Orkiestra Dęta &quot;Szałamaje&quot; przemianowana p&oacute;źniej na &quot;Zbąszyńskie dziewczęta&quot;. Od samego początku orkiestra ta obok szkolnej kapeli ludowej stała się wizyt&oacute;wką muzyczną Zbąszynia zar&oacute;wno w regionie jak i w wielu innych miastach Polski. <br />W 40-leciu istnienia szkołę ukończyło 592 absolwent&oacute;w, z kt&oacute;rych wielu kontynuowało naukę w szkołach muzycznych typu średniego i Akademiach Muzycznych. </p>";s:5:"osoba";N;s:24:"x_bibl