:"x_filharmonia";N;s:17:"x_biblioteki_inne";N;s:3:"lat";s:10:"52.4076712";s:3:"lng";s:10:"16.9334123";}i:5025;a:31:{s:2:"id";i:5025;s:7:"entered";i:1412141084;s:7:"changed";i:1582368928;s:7:"logotyp";N;s:4:"foto";N;s:5:"nazwa";s:39:"Księgarnia i Klub Głośna Samotność";s:6:"powiat";N;s:3:"kod";s:6:"61-815";s:6:"miasto";s:7:"Poznań";s:5:"ulica";s:56:"ul. Ratajczaka 18 (tuż przy wejściu do Pasażu Apollo)";s:7:"telefon";s:18:"tel. 061 852 48 00";s:7:"godziny";N;s:5:"email";s:25:"poczta@glosnasamotnosc.pl";s:3:"www";s:23:"www.glosnasamotnosc.pl/";s:4:"html";s:1527:"Księgarnia i Klub Głośna Samotność to owoc fascynacji literaturą, sztuką i&hellip; słodkościami. Podobnie jak warszawski Czuły Barbarzyńca, jest miejscem o niezwykłej atmosferze. Przygodę z książkami nasi goście mogą rozpocząć na wygodnych kanapach, popijając kawę, herbatę czy kieliszek wina. Apetytu lekturze dodadzą słodkie przysmaki. Podr&oacute;ży w świat literatury towarzyszy cicha muzyka i serdeczna atmosfera.
<div>Głośna Samotność jest miejscem otwartym na przejawy działalności literackiej, artystycznej oraz społecznej. Organizuje liczne wydarzenia kulturalne, w tym spotkania z pisarzami i wydawcami oraz promocje ich najnowszych książek, wieczory poezji, wystawy artyst&oacute;w czy też dyskusje z ludźmi zaangażowanymi w r&oacute;żnorodne obszary działalności społecznej.</div>
<div>Powierzchnia klubu liczy 100 m2, zlokalizowana jest na dw&oacute;ch poziomach. Na parterze z wejściem od ul. Ratajczaka 18, usytuowana jest księgarnia i bar. Ta część przystosowana jest dla niepełnosprawnych, znajdują się w niej miejsca dla os&oacute;b palących. Na antresoli znajduje się wygodna część klubowa (dla niepalących). Klub dysponuje dobrym nagłośnieniem, bezprzewodową og&oacute;lnodostępną siecią komputerową (Wi-Fi) oraz projektorem multimedialnym. Posiada klimatyzację i wentylację zapewniającą komfort przebywającym w niej osobom. &nbsp;</div>
